Forestry managed investment scheme deduction number - Inform the relevant field with the forestry managed investment scheme deduction number.
If the company's interests in an FMIS are covered by a product ruling, then  inform the product ruling number in this  field;
if the company's interests in an FMIS are covered by a private ruling, write the authorisation number that was printed on the front page of your notice of private ruling in this field.

Forestry managed investment scheme deduction Year - Inform the relevant field with the forestry managed investment scheme deduction year.
If the company's interests in an FMIS are covered by a product ruling, then inform the year of the product ruling in this field;
if the company's interests in an FMIS are covered by a private ruling, then leave this field blank.
